/* Procedure structure for procedure `insertEstacionamiento` */

/*!50003 DROP PROCEDURE IF EXISTS  `insertEstacionamiento` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `insertEstacionamiento`(IN codplaca VARCHAR(8), IN cod_tareaje VARCHAR(25), IN coduser INT(5), IN lad VARCHAR(2), IN casilla INT(2))
BEGIN	
	
	
	INSERT INTO mpvehiculo	
	(idvehiculo, placa		,id_tareaje	,iduserreg	,horainicio	,horafinal			,idestado	,lado	,casillero,fecreg ) VALUES  
	(
	(
	SELECT CONCAT(IFNULL(LPAD(MAX(SUBSTRING(VE.idvehiculo,1,25))+1,25,'0'),LPAD('1',25,'0')), '-' , DATE_FORMAT(NOW(),"%Y"))
	FROM 	mpvehiculo VE
	WHERE 	SUBSTRING(VE.idvehiculo,27,5) 	= DATE_FORMAT(NOW(),"%Y")        
	AND 	DATE_FORMAT(VE.fecreg,"%Y") 	= DATE_FORMAT(NOW(),"%Y")
	)
	,codplaca	
	,cod_tareaje	
	,coduser	
	,NOW()		
	,ADDTIME(NOW()	
	, (
	SELECT CA.`tiempoparqueo`
	FROM `mp_tareaje` TA
	INNER JOIN `mp_cuadras` CU 	ON CU.`id_cuadras`=TA.`id_cuadras`
	INNER JOIN `mpcalle` CA 	ON CA.`codvia`=CU.`id_via` 
	INNER JOIN `mp_turno` TU	ON TU.`id_turno`=TA.`id_turno`
	WHERE TA.`fecha_tarea`=DATE_FORMAT(NOW(), "%Y-%m-%d") 
	aND TA.`iduser_parqueador`=coduser
	AND TU.`hora_ingreso` < TIME_FORMAT(NOW(), '%H:%i:%s')
	AND TU.`hora_fin`> TIME_FORMAT(NOW(), '%H:%i:%s')
	LIMIT 1 	
	))	
	,'1'
	,lad 
	,casilla
	,now());
	
	SELECT CONCAT(IFNULL(LPAD(MAX(SUBSTRING(VE.idvehiculo,1,25)),25,'0'),LPAD('1',25,'0')), '-' , DATE_FORMAT(NOW(),"%Y")) as ID
	FROM 	mpvehiculo VE
	WHERE 	SUBSTRING(VE.idvehiculo,27,5) 	= DATE_FORMAT(NOW(),"%Y") 
	AND 	DATE_FORMAT(VE.fecreg,"%Y") 	= DATE_FORMAT(NOW(),"%Y");
	
 END */$$
DELIMITER ;

/* Procedure structure for procedure `selectGruas` */

/*!50003 DROP PROCEDURE IF EXISTS  `selectGruas` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `selectGruas`()
BEGIN
		SELECT  @i:=@i+1 AS numeracion
		, VE.`idvehiculo`
                , VE.`placa`
                , VE.`horainicio`
                , VE.`horafinal`
                , VE.`idestado`
                , EV.`txtestado`
                , IF(ISNULL(VE.`usermod`),'',VE.`usermod`) AS USERMOD
                , CA.`tiempoparqueo`
                ,CONCAT(CA.`tipoVia`,' ',CA.`nombrevia`) AS CALLE
                , CU.`cuadra`
                , VE.`lado`
                ,VE.`casillero`
                ,TIMEDIFF(NOW(),VE.`horafinal`) AS TiempoDiferencia                
                , IF(TIMEDIFF(NOW(),VE.`horafinal`) < '00:15:00' ,'1', '2') AS EstadoGrua
                FROM `mpvehiculo` VE
                INNER JOIN (SELECT @i:=0) AS foo
                INNER JOIN `mp_tareaje` TA ON TA.`id_tareaje`=VE.`id_tareaje`
                INNER JOIN `mp_cuadras` CU ON CU.`id_cuadras`=TA.`id_cuadras`
                INNER JOIN `mpestadovehiculo` EV ON EV.`idestado`=VE.`idestado`
                INNER JOIN `mpcalle` CA ON CA.`codvia`=CU.`id_via`
                WHERE DATE_FORMAT(VE.`horainicio`,'%Y-%m-%d')=DATE_FORMAT(NOW(),'%Y-%m-%d')
		AND TIMEDIFF(NOW(),VE.`horafinal`)>'00:00:00'
                AND VE.`idestado` <> 4 ;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `selectParqueado` */

/*!50003 DROP PROCEDURE IF EXISTS  `selectParqueado` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `selectParqueado`(IN iduser INT(6),IN estadoVehiculo INT(2))
BEGIN
	SELECT VE.idvehiculo
	, VE.`placa`
	, VE.`horainicio`
	, VE.`horafinal`
	,VE.`idestado`
	,TIMEDIFF(VE.`horafinal`,NOW()) as diferencia
	,IF(TIMEDIFF(NOW(),VE.`horafinal`) < '00:15:00' ,'1', '2') AS EstadoGrua
	,iduserreg 
	FROM `mpvehiculo` VE
	INNER JOIN `mp_tareaje` TA ON TA.`id_tareaje`=VE.`id_tareaje`
	WHERE if(STRCMP(estadoVehiculo,'1'),VE.`idestado` = estadoVehiculo,VE.`idestado` IN (1,6))
	AND VE.`iduserreg`=iduser
	AND DATE_FORMAT(VE.`horainicio`,'%Y-%m-%d')=DATE_FORMAT(NOW(),'%Y-%m-%d')
	order by diferencia desc;
 END */$$
DELIMITER ;

/* Procedure structure for procedure `selectTareajes` */

/*!50003 DROP PROCEDURE IF EXISTS  `selectTareajes` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `selectTareajes`(in p1 int(5))
BEGIN
	SELECT TA.`id_tareaje`,CONCAT(CA.`tipoVia`,' ',CA.`nombrevia`,' ',CU.`cuadra`) AS calle FROM `mp_tareaje` TA
	INNER JOIN `mp_turno` TU ON TA.`id_turno`=TU.`id_turno` AND DATE_FORMAT(NOW(),'%H:%i:%S')>TU.`hora_ingreso`
	INNER JOIN `mp_cuadras` CU ON TA.`id_cuadras`=CU.`id_cuadras`
	INNER JOIN `mpcalle` CA ON CU.`id_via`=CA.`codvia`
	WHERE TA.`fecha_tarea`=DATE_FORMAT(NOW(),'%Y-%m-%d')
	AND TA.`iduser_parqueador`=p1;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `update_mpvehiculo` */

/*!50003 DROP PROCEDURE IF EXISTS  `update_mpvehiculo` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `update_mpvehiculo`(in estado int, in nomUser varchar(30), in id varchar(30))
BEGIN	
	DECLARE estadoBD INT(4);
	declare response varchar(5);
	
	SELECT VE.`idestado` INTO @estadoBD FROM `mpvehiculo` VE WHERE VE.`idvehiculo`=id;
	
	if(@estadoBD<> estado)then 
		UPDATE `mpvehiculo` VE
		SET VE.`idestado`=estado, VE.`fecmod`=NOW(), VE.`usermod`=nomUser
		WHERE VE.`idvehiculo`=id;
		
		
		SET response = 'true';
 
	else
		SET response = 'false';
	END IF;
			
	SELECT response FROM DUAL;
	
    END */$$
DELIMITER ;

